import React from "react";
import '../styles.css';
import { useState, useEffect } from "react";

export default function MovieGrid(){
    const [movies, setMovies] = useState([]);
    useEffect(() => {
        //const m = ["a","b","c"];
        fetch("movies.json")
        .then(response => response.json())
        .then(data => setMovies(data));
    },[])

    return(
        <div>
            {movies}
        </div>
    )
}
